import LoaiSanPham from "./loai_san_pham";
import Hearder from './header';
import Banner from './banner';
import Footer from './footer';
function Trangchu(){
  const dsLoaiSanPham=[
    {
      'ten':'loại Sản Phẩm 1',
      'ds_san_pham':[
        {
          'hinh_anh':'./2.jpg',
          'ten':'Sản Phẩm 1',
          'gia':'chỉ được xe',
          'mota':'vip1',
        },
        {
          'hinh_anh':'./1.jpg',
          'ten':'Sản Phẩm 2',
          'gia':'1000',
          'mota':'vip2',
        },
        {
          'hinh_anh':'./1.jpg',
          'ten':'Sản Phẩm 3',
          'gia':'1000',
          'mota':'vip2',
        },
      ]
    },
    {
      'ten':'Loại Sản Phẩm 2',
      'ds_san_pham':[
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 3',
          'gia':'1000',
          'mota':'vip3',
        },
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 4',
          'gia':'10000',
          'mota':'vip4',
        },
      ]
      
      
    },
    {
      'ten':'Loại Sản Phẩm 3',
      'ds_san_pham':[
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 5',
          'gia':'1000',
          'mota':'vip5',
        },
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 6',
          'gia':'1000',
          'mota':'vip6',
        },
      ]
      
      
    }
  ];


  const listLoaiSanPham=dsLoaiSanPham.map(function(item){
    return(

      <LoaiSanPham data ={item}/>
    );
  });
  return(
    <>
     <Banner/>
    <Hearder/>
    {listLoaiSanPham}
    <Footer/>
    </>
  )
};


export default Trangchu;
